import Stopwatch from "./Components/Stopwatch";
import Countdown from "./Components/Countdown";

const App = () => {
  return (
    <>
      <h1>Timers</h1>
      <a href="">Show Stopwatch</a>
      <a href="">Show Countdown</a>
      <Stopwatch />
      <Countdown />
    </>
  );
};

export default App;
